pragma solidity ^0.8.0;

import "./verifier.sol";

contract VotingSystem is Verifier {

    address public owner;
    bool public electionOpen = true;

    // Merkle root pública
    uint256 public root;

    // Conteo
    uint256 public votes0;
    uint256 public votes1;

    // Nullifiers usados
    mapping(uint256 => bool) public nullifierUsed;

    event VoteEmitted(
        uint256[2] c1,
        uint256[2] c2,
        uint256 nullifier
    );

    event ResultsPublished(uint256 votes0, uint256 votes1);

    constructor(uint256 _root) {
        owner = msg.sender;
        root = _root;
    }

    // ---------------------------
    // EMISIÓN DE VOTO
    // ---------------------------
    function registerVote(
        Proof calldata proof,
        uint[4] calldata publicInputs, 
        uint256 nullifier,
        bool vote
    ) external {
        require(electionOpen, "Eleccion cerrada");
        require(!nullifierUsed[nullifier], "Nullifier ya utilizado");

        // Verificación ZK
        require(
            verifyTx(proof, publicInputs),
            "Invalid ZK proof"
        );

        nullifierUsed[nullifier] = true;

        if (vote) {
            votes1 += 1;
        } else {
            votes0 += 1;
        }

        emit VoteEmitted(
            [publicInputs[0], publicInputs[1]],
            [publicInputs[2], publicInputs[3]],
            nullifier
        );
    }

    // ---------------------------
    // CIERRE
    // ---------------------------
    function closeElection() external {
        require(msg.sender == owner, "Only owner");
        electionOpen = false;
    }

    // ---------------------------
    // RESULTADOS
    // ---------------------------
    function publishResults() external {
        require(msg.sender == owner, "Only owner");
        require(!electionOpen, "Election still open");

        emit ResultsPublished(votes0, votes1);
    }
}

